import React, { useState } from "react";
import { ThemeProvider, useTheme } from '@mui/material/styles';
import {
  AppBar, Box, Toolbar, Typography, MenuItem, Link, IconButton, Menu, TextField, InputAdornment,
  Paper, Grid
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Sidebar from '../SideBar/SideBar'; // Assurez-vous que le chemin est correct

const pages = ['Datasets', 'Top Stocks', 'Stock Alerts', 'AI Stock Picks'];

export default function Layout({ children }) {
  const theme = useTheme();
  const [anchorEl, setAnchorEl] = useState(null);
  const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = useState(null);
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const isMenuOpen = Boolean(anchorEl);

  const handleProfileMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMobileMenuClose = () => {
    setMobileMoreAnchorEl(null);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
    handleMobileMenuClose();
  };

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  const menuId = 'primary-search-account-menu';
  const renderMenu = (
    <Menu
      anchorEl={anchorEl}
      anchorOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      id={menuId}
      keepMounted
      transformOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      open={isMenuOpen}
      onClose={handleMenuClose}
    >
      <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
      <MenuItem onClick={handleMenuClose}>My account</MenuItem>
      <MenuItem onClick={handleMenuClose}>Logout</MenuItem>
    </Menu>
  );

  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Toolbar>
            <IconButton
              size="large"
              edge="start"
              color="inherit"
              aria-label="open drawer"
              onClick={toggleSidebar}
              sx={{ mr: 2 }}
            >
              <MenuIcon />
            </IconButton>
            <TextField
              variant="outlined"
              placeholder="Search Stocks & Crypto"
              sx={{ flex: 1 }}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <SearchIcon />
                  </InputAdornment>
                ),
              }}
            />
            {pages.map((page) => (
              <MenuItem key={page} sx={{ color: 'WHITE', display: 'block' }}>
                <Link to={`/${page.toLowerCase().replace(/\s+/g, '')}`} color="inherit">
                  {page}
                </Link>
              </MenuItem>
            ))}
            <Box sx={{ flexGrow: 1 }} />
            <IconButton
              edge="end"
              aria-label="account of current user"
              aria-controls={menuId}
              aria-haspopup="true"
              onClick={handleProfileMenuOpen}
              color="inherit"
            >
              <AccountCircle />
            </IconButton>
          </Toolbar>
        </AppBar>
        {renderMenu}
        <Sidebar open={sidebarOpen} onClose={toggleSidebar} />
      </Box>
      <Box sx={{ display: 'flex' }}>
        <Grid container spacing={0.5} sx={{ flexGrow: 1, mt: 0.25 }}>
          <Grid item xs={2.5}>
            <Paper sx={{ minHeight: "86vh", background: `linear-gradient(135deg,#D3D3D3, #D3D3D3)` }}>
              {/* Ajoutez le contenu de votre sidebar ici */}
            </Paper>
          </Grid>
          <Grid item xs={9.5}>
            <Paper sx={{ minHeight: "86vh", background: `linear-gradient(135deg,#D3D3D3, #D3D3D3)` }}>
              {children}
            </Paper>
          </Grid>
        </Grid>
      </Box>
    </ThemeProvider>
  );
}
